import React from 'react';
import Translate from 'react-translate-component';
import { Row, Col, Nav, Navbar } from 'react-bootstrap';
import '../Style/Navigation.css';
import counterpart from 'counterpart';
import en from '../lang/en';
import { BrowserRouter, Route, NavLink ,Outlet} from 'react-router-dom';

counterpart.registerTranslations('en', en);

class Navigation extends React.Component {
    render() {
        return (
            <Navbar collapseOnSelect expand="lg">
                <Navbar.Brand />
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="navigation">
                        <Row>
                            <Col xl={12}>
                                <BrowserRouter>
                                    <Nav.Link href="/">
                                        <p className="text-semi-bold first-element">
                                            <Translate content="navigation.title" />
                                        </p>
                                    </Nav.Link>
                                    <Nav.Link>
                                        <p className="text-semi-bold">
                                            <Translate content="navigation.new" />
                                        </p>
                                    </Nav.Link>
                                    <nav>
                                    <NavLink to='/project'>
                                        <Translate content="navigation.project" />
                                        <NavLink><Translate content="navigation.customer" /></NavLink>
                                        <NavLink><Translate content="navigation.supplier" /></NavLink>
                                    </NavLink>
                                    </nav>
<Outlet>
    
</Outlet>
                                </BrowserRouter>

                            </Col>
                        </Row>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}

export default Navigation;
